import React from "react";
import Card from "./emoji_card";
import emojis from "../emoji_dictionary";


// function createEmoji(){
// <Card icon={emojis[0].emoji} name={emojis[0].name} desc={emojis[0].category}  code={emojis[0].html}/>
// }
const all = document.getElementById('all');
let emj = emojis;
		

function app(){
    return (
    <div>
    <h1>emojipedia</h1>
    <Card icon={emojis[0].emoji} name={emojis[0].name} desc={emojis[0].category}  code={emojis[0].html}/>

    {/* {emojis.map(createEmoji)} */}

    <div id="all" >{all.innerText=emoji}</div>


    </div>
    );
}

export default app;
